```java
@Bean(name="validationProfile")
public Profile validationProfile(){
    Profile profile = new Profile();
    profile.getParams().put("ignore_field_missing", "false");
    profile.put("messages_files","[your custom message file]");
    CustomRule rule = new CustomRule("my.company.MyRules");
    profile.registerCustomRule(rule);
    return profile;
}
```

